define({"topics" : [{"title":"Collected System Metrics","shortdesc":"\n               <p class=\"shortdesc\">The System Metrics origin uses the psutil package for the Go programming language (or         Golang) to collect system metrics.\n                  \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/SystemMetrics.html#concept_br2_rgr_l2b","attributes": {"data-id":"concept_br2_rgr_l2b",},"menu": {"hasChildren":false,},"tocID":"concept_br2_rgr_l2b-d46e109823","topics":[]},{"title":"Filter Process Metrics","shortdesc":"\n               <p class=\"shortdesc\">The System Metrics origin can read metrics from processes running on the edge device.         When configured to read process\n                  metrics, the origin reads statistics for all running         processes by default. \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/SystemMetrics.html#concept_trh_kgh_3fb","attributes": {"data-id":"concept_trh_kgh_3fb",},"menu": {"hasChildren":false,},"tocID":"concept_trh_kgh_3fb-d46e109848","topics":[]},{"title":"Configuring a System Metrics Origin","href":"datacollector\/UserGuide\/Origins\/SystemMetrics.html#task_bpg_tmv_32b","attributes": {"data-id":"task_bpg_tmv_32b",},"menu": {"hasChildren":false,},"tocID":"task_bpg_tmv_32b-d46e109883","topics":[]}]});